import { createRouter, CreateWebHistory } from 'vue-router'
import BodyGlobal from './../components/BodyGlobal'

const routes = [
    {
    path: '/',
    name: 'Home',
    component: BodyGlobal,
    }
]
const router = createRouter({history: CreateWebHistory(), routes})
export default router
